import React, { useState, useEffect, useRef } from "react";
import Selector from './components/Selector'
import ReactJson from 'react-json-view';

// change it to cyclops.cse.iitk.ac.in
//const SERVER="http://cyclops.cse.iitk.ac.in:5000/"
 const SERVER="http://localhost:5000/"

async function contactServer(endpoint, query) {
    var fetchlink
    if (query == null)
        fetchlink = SERVER + endpoint
    else
        fetchlink = SERVER + endpoint + "?" + query
    return fetch(fetchlink, {method : "GET"})
.then(response => response.json())
.then(data => {console.log("Sending request for " + fetchlink + " \n"); return data;})
.catch(console.log("Got error\n"));
}

//const passcode = React.createRef();
function View() {
    const [passcode2, setPasscode2] = useState("");
    const [entries, setEntries] = useState("");
    function DisplayFiles() {
        console.log("inview" +  entries)
        var fileDetails = (entries);
        var files = Object.keys(fileDetails);
        console.log("in dis " + files)
        var div = ""
        if(files[0] === null || files === null){
            return (<div>There is nothing to show.</div>);
        }
        else{
        return (
                <div>
                    <span className="px-1"></span>

                    {files.map(f => (
                        <div>

                            <div className="flex flex-row ">

                                <div className="font-bold text-gray-800"> File Name: </div> <span className="px-1"></span> <div className="text-blue-700 font-bold">{ f.replace("\"","").replace("\"","") }</div>

                            </div>
                            <ReactJson name={false}
                                       displayObjectSize={false}
                                       displayDataTypes={false}
                                       enableClipboard={false}
                                       src={JSON.parse(fileDetails[f])} theme="monokai" />
                            <span className="px-1"></span>
                        </div>

                    ))
                    }
                </div>
            );
        // }
        }
    }

    function page() {
        return (
        <div><span className="px-1"></span>
             <div className="text-blue-800 font-bold"> Enter the passcode </div>
        <div className='login flex flex-row items-center'>
            {/* Sumit : Edited this */}
            <input className="shadow-sm font-mono appearance-none block text-gray-700 font-bold"
                type="text" value={passcode2} onChange={handleInput} />
            {/* Sumit : Edited this */}
            <span className="px-1"></span>
            <button className="text-center text-white-400 font-bold rounded-lg py-1 px-1
                focus:outline-none bg-green-300 border-2 shadow-lg border-green-600" id="submit" name="check" value="check" type="submit"
                  onClick={handleClick}>Check</button>
            {/* Sumit : Added this for small space this */}
            <span className="px-1"></span>
            {/*<button className="text-center text-blue-700 font-bold rounded-lg py-1 px-1*/}
            {/* focus:outline-none bg-blue-300 border-2 shadow-lg border-blue-700" id="reset" name="reset" value="reset" type="submit"*/}
            {/*    onClick={() => window.location.reload(false)}>Reset</button>*/}
        </div>
        <div>
            {entries ? <DisplayFiles></DisplayFiles> : ""}
        </div>
        </div>
        )
    }

    // e is the event object ("target" is a property of the event object. https://www.w3schools.com/jsref/obj_event.asp)
  const handleInput = (e) => {setPasscode2(e.target.value); console.log("Got " + e.target.value);}

    function handleClick() {
        console.log("Hello" + passcode2);
        LoadProblem(passcode2);
        //return (
        //    <LoadProblem value={passcode.value} />
        //)
    }

function LoadProblem(msg) {
    console.log("World" + msg);
    //const passcode = this.refs[this.state.passcode].value;
